let home = (function () {
    return {
        logo: 'data:image/png;base64,',
        btnDownload: 'bzk-btn-download',
        apiUrl: 'http://google.com.vn/api/upload',
        template: function(){
            let html = `
                <div id="bzk-ai">
                   <div class="bzk-message">
                    <div class="res-message" id="bzk-msg">Success</div>
                    <button class="btn-bzk" id="bzk-btn-download">データを自動に取得</button>
                    <div class="bzk-icon">
                        <img src=${this.logo} alt="">
                    </div>
                   </div>
                </div>
            `;
            let style = document.createElement('style');
            style.innerHTML = `
                #bzk-ai{
                    position: fixed;
                    top: 115px;
                    right: 0;
                    padding: 20px;
                    z-index: 99;
                }
                #bzk-ai .bzk-message{
                    display: flex;
                    align-items: center;
                    justify-content: space-between;
                }
                #bzk-ai .bzk-message .res-message{
                    padding: 10px 20px;
                    margin-right: 10px;
                    border: 1px solid #75dbd9;
                    font-size: 1em;
                    display: none;
                    box-shadow: 0px 0px 20px #75dbd9;
                    border-radius: 5px;
                }
                #bzk-ai .bzk-message .btn-bzk{
                    background: linear-gradient(#75dbd9, #13b7b4);
                    color: white;
                    padding: 10px 20px;
                    margin-right: 10px;
                    font-size: 1em;
                    border-radius: 5px;
                    box-shadow: 0px 0px 20px #75dbd9;
                    cursor: pointer;
                    border:none; 
                }
                #bzk-ai .bzk-message .bzk-icon{
                    width: 50px;
                    height: 50px;
                    border-radius: 50%;
                    display: flex;
                    justify-content: center;
                    align-items: center;
                    background-color: #fff;
                    cursor: pointer;
                    box-shadow: 0px 0px 20px #ccc
                }
                #bzk-ai .bzk-message .bzk-icon img{
                    width: 60%;
                    height: 60%;
                    object-fit: cover;
                }
            `;
            let wrap = document.createElement('div');
            wrap.setAttribute('id', 'bzk-ai-context');
            wrap.innerHTML = html;
            document.head.appendChild(style);
            document.body.append(wrap);
        },
        initEvent: function () {
            const btnDownload = document.getElementById(this.btnDownload);
            if (btnDownload) {
                btnDownload.addEventListener('click', () => {
                    this.downloadFile();
                });
            }
        },
        getLink: function(){
            return '1111';
        },
        downloadFile: function(){
            const link = this.getLink();
            console.log('clicked');
            console.log(link);
            this.send().then(res => {
                if(res.status === 201){
                    this.showMessage();
                }else{
                    console.log('error');
                }
            }).catch(error => {
                alert(`Server error ${error}`);
            })
        },
        send: function(){
            const apiUrl = this.apiUrl;
            return new Promise(resolve => {
                setTimeout(() => {
                    resolve({
                        status: 201,
                        message: 'Success',
                        data: {}
                    })
                },3000)
            });

        },
        getElementButton: function(){
            return document.getElementById('bzk-btn-download');
        },
        getElementMessage: function(){
            return document.getElementById('bzk-msg');
        },
        showMessage: function(){
            const msgElement = this.getElementMessage();
            const btnButton = this.getElementButton();
            msgElement.style.display = 'block';
            btnButton.style.display = 'none';
        },
        init: function () {
            this.template();
            this.initEvent();
        }
    }
})();

(function () {
    'use strict';
    window.onload = function () {
        console.clear();
        home.init();
    }
})();




